CREATE TABLE IF NOT EXISTS "api_staff" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "employee_number" varchar(20) NOT NULL UNIQUE, "name" varchar(100) NOT NULL, "name_kana" varchar(100) NOT NULL, "position" varchar(100) NOT NULL, "email" varchar(254) NOT NULL, "phone" varchar(20) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "department_id" bigint NULL REFERENCES "api_department" ("id") DEFERRABLE INITIALLY DEFERRED, "photo_url" varchar(100) NULL);
